import React, { useState } from 'react'
import "./register.css"

function Register() {

    const[user,setUser]=useState(
        {
            name:"",
            email:"",
            password:"",
            reEnterPassword:""
        }
    )

    function handleChange(e)
    {
        const name = e.target.name
        const value = 
        setUser({...user,[name]:value})
    }


  return (
    
    <center>
    <br></br>
    <br></br>
    <div className='register'>
        {console.log("User",user)}
      <h1>Register</h1>
      <input type="text" name="name"  value={user.name} placeholder='Enter Your Name' onChange={handleChange}></input>
      <input type="email" name="email" value={user.email} placeholder='Enter Your Email' onChange={handleChange}></input>
      <input type="password" name="password"  value={user.password} placeholder='Enter Your Password' onChange={handleChange}></input>
      <input type="email" name="reEnterPassword" value={user.reEnterPassword} placeholder='Confirm Password' onChange={handleChange}></input>
      <div className='button'>Register</div>
      <div>or</div>
      <div className='button'>Login</div> 
    </div>
    </center>
  )
}

export default Register
